import { Text,TextInput, Button, Group, Box, Card,Grid, Chip, Badge, Center,PasswordInput, JsonInput} from '@mantine/core';
import axios from 'axios';
import { notifications } from '@mantine/notifications';
import { IconCheck,IconAlertCircle, IconFaceIdError, IconEarOff, IconFaceId,IconLock, IconUserCircle, IconAt } from '@tabler/icons-react';
import { useForm } from '@mantine/form';
import { useDisclosure } from '@mantine/hooks';

function PasswordAuth(){
    let email = '';
    let Password = '';
    let policy = '';
    const form = useForm({
        initialValues: { email: '', password: '',policy:'AT_RESPWD',channel:'CH_DIRECT'},
    
        // functions will be used to validate values at corresponding key
        validate: {
          email: (value) => (/^\S+@\S+$/.test(value) ? null : 'Invalid email'),
          password: (value) => (value.length < 4 ? 'Password length must be at least 4 characters.' : null),
          policy: (value) => (value.length < 4 ? 'Authentication Policy cannot be less than 4 characters': null),
        },
      });

      return(
                <Box pos="relative" sx={(theme) => ({
        backgroundColor: theme.colorScheme === 'dark' ? theme.colors.dark[6] : theme.colors.gray[0],
        padding: theme.spacing.xl,
        borderRadius: theme.radius.md,
        cursor: 'pointer',

        '&:hover': {
          backgroundColor:
            theme.colorScheme === 'dark' ? theme.colors.dark[5] : theme.colors.gray[1],
        },
      })}
      >
                   <Center><h3>Test Password Authenticator.</h3></Center>

        
                <form>
                    <TextInput label="Email" placeholder='Please enter your Email' {...form.getInputProps('email')} />
                    <PasswordInput label="Password" placeholder='' {...form.getInputProps('password')} />
                    <TextInput label="Authentication Policy" placeholder='AT_RESPWD' {...form.getInputProps('policy')} />
                    <TextInput label="Channel" placeholder='CH_DIRECT' {...form.getInputProps('channel')} />
                    <br/>
                    <Center>
                    <Button type='submit'>
                        Login
                    </Button>
                    </Center>
                    <JsonInput
                    label="Response Body"
                    placeholder="JSON Response Body"
                    validationError="Invalid JSON"
                    formatOnBlur
                    autosize
                    minRows={4}
                    id="resBody">

                    </JsonInput>
                </form>
               
                </Box>
            
      );

}

export default PasswordAuth;
